import React from 'react';
import styled from 'styled-components';

const EnrollArea = styled.div`
    background-color: #fff;
    width: 1200px;   
    height: 800px;
    border-radius: 2px;
    box-shadow: 0px 5px 10px 1px #0004;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 30px;
`;

const EnrollTable = styled.table`
    border-top: 1px solid #337;
    width: 100%;
`;

const EnrollTableHead = styled.tr`
    border-bottom: 1px solid #ccd;
    height: 30px;
    padding: 7px 3px;
`;

const EnrollList = () => {
    return (
        <EnrollArea>
            <EnrollTable>
                <colgroup>
                    <col style={{ width: "70px" }}/>
                    <col/>
                    <col style={{ width: "110px" }}/>
                    <col style={{ width: "100px" }}/>
                    <col style={{ width: "80px" }}/>
                    <col style={{ width: "70px" }}/>
                    <col style={{ width: "70px" }}/>
                </colgroup>
                <thead>
                    <EnrollTableHead>
                        <th>#</th>
                        <th>제목</th>
                        <th>작성자</th>
                        <th>작성일</th>
                        <th>조회</th>
                        <th>추천</th>
                        <th>스크랩</th>
                    </EnrollTableHead>
                </thead>
                <tbody>

                </tbody>
            </EnrollTable>
        </EnrollArea>
    );
};

export default EnrollList;
